import { Card, Row, Col } from "react-bootstrap"


import './CarsCard.css'

function CarsCard({ cars }) {


    return (
        <>
        <div>
            {pages}
        </div>

        <Row xs={1} md={4} className="g-4">
            {Array.from({ length: 3 }).map((_, idx) => (
                <Col key={idx}>
                <div>
                    <Card>
                        <Card.Body>
                            <Card.Title><p>{cars.BRAND}</p></Card.Title>
                            <Card.Text>
                                {cars.MODEL}
                            </Card.Text>
                            <Card.Text>
                                {cars.DEALER}
                            </Card.Text>
                            <Card.Text>
                                {cars.MIN_MILEAGE}
                            </Card.Text>
                            <Card.Text>
                                {cars.MAX_MILEAGE}
                            </Card.Text>
                        </Card.Body>
                    </Card>
                </div>
                </Col>
            ))}
        </Row>
        </>
    )
}

export default CarsCard;
